//unused
import React from 'react'
import { connect } from 'react-redux'

interface Item {
  id: string,
  title?: string,
  created?: Date,
  tags?: string[]
}

interface Tags {
  tag: string,
  count?: number,
}

interface ItemProps {
  userItems: Item[],
  userTags: Tags[],
}

export class QueryTable extends React.Component <ItemProps, any> {
  constructor(props: any) {
    super(props)
    this.state = {

    }
  }

  public static defaultProps = { userItems: [{id:'',}], userTags: [{tag:''}]}

  render() { console.log("query-table")
    return (
      <form>
        <table className="center">
          <thead>
            <tr>
              <th>title</th><th>created</th><th>tags</th><th><button>add tag(s)</button></th>
            </tr>
          </thead>
          <tbody>
            {this.props.userItems.map((userItems,index) => (
            <tr key={index} id={userItems.id}>
              <td>{userItems.title}</td>
              <td>{userItems.created?.toDateString()}, Unix:{userItems.created?.getTime().toString()}</td> 
              <td> 
                {userItems.tags?.map((tag,index) => (
                  <button key={index}>{tag}</button>
                ))}
              </td>
              <td>
                <select>
                  {this.props.userTags.map((userTags,index) => (
                    <option key={index} value={userTags.tag}>{userTags.tag}</option>
                  ))}
                </select>
              </td>
            </tr>
            ))}
          </tbody>
        </table>
      </form>
    )
  }
}

const mapStateToProps = ({ query: { userItems, userTags }}:any) => ({
  userItems,
})

export default connect(mapStateToProps, )(QueryTable)
